import React from 'react';
import { Route, Navigate } from "react-router-dom";

export default function ProtectedRoute ({ element: Component, ...props }) {
  return (
    <Route>{
        () => props.isLoggedIn ? <Component {...props}/> : <Navigate to="/sign-in"/>
    }
    </Route>
)};
